import React, { Component } from 'react';
import EN from '../../../../constant/en';
import VariableImpact from '../../Result/VariableImpact';
const ROCCurve =
  'data:image/svg+xml;base64,';
const rocSelected =
  'data:image/svg+xml;base64,';
const varImpactNormal =
  'data:image/svg+xml;base64,';
const varImpactSelected =
  'data:image/svg+xml;base64,';
import styles from './DetailCurves.module.css';
import Thumbnail from './Thumbnail';
import PredictTable from './PredictTable';
import { MultiRoc } from '../../../Charts';

interface Interface {
  model: any
  project: any
}

export default class MultiClassificationDetailCurves extends Component<Interface> {
  state = {
    curve: EN.ROCCurve,
    show: true,
  };
  handleClick = val => {
    this.setState({ curve: val });
  };
  reset = () => {
    this.props.model.resetFitIndex();
    this.setState({
      show: false,
    },()=>{
      this.setState({
        show: true,
      });
    });
  };

  componentWillReceiveProps(nextProps) {
    if (nextProps.isHoldout !== this.props.project.isHoldout) {
      this.setState(
        {
          show: false,
        },
        () => {
          this.setState({
            show: true,
          });
        },
      );
    }
  }

  render() {
    const {
      model,
      project,
    } = this.props;
    const {chartData} = model;
    const { isHoldout, mapHeader } = project;
    const { curve, show } = this.state;
    let curComponent;

    switch (curve) {
      case EN.ROCCurve:
        curComponent = show && <MultiRoc chartData={chartData}/>;
        break;
      case EN.VariableImpact:
        curComponent = (
          <div style={{ fontSize: 50 }}>
            <VariableImpact model={model} mapHeader={mapHeader} />
          </div>
        );
        break;
      default:
        break;
    }
    const thumbnails = [
      {
        normalIcon: ROCCurve,
        hoverIcon: ROCCurve,
        selectedIcon: rocSelected,
        text: EN.ROCCurve,
      },
      {
        normalIcon: varImpactNormal,
        hoverIcon: varImpactNormal,
        selectedIcon: varImpactSelected,
        text: EN.VariableImpact,
      },
    ];
    return (
      <div className={styles.detailCurves}>
        <div className={styles.leftPanel} style={{ flex: 1 }}>
          <div className={styles.thumbnails}>
            {thumbnails.map((tn, i) => (
              <Thumbnail
                curSelected={curve}
                key={i}
                thumbnail={tn}
                onClick={this.handleClick}
                value={tn.text}
              />
            ))}
          </div>
          {/*<PredictTable isHoldout={isHoldout} model={model} yes={yes} no={no} />*/}
        </div>
        <div className={styles.rightPanel} style={{ marginLeft: 10 }}>
          {curComponent}
        </div>
      </div>
    );
  }
}
